import React from 'react';
import './App.css';
import SERIES from './components/SERIES';
import SERIES_ALL from './components/SERIES_ALL';

function App() {
  return (
    <div className="App">
      <SERIES />
      <SERIES_ALL />
      <div className='seriers_all_outer'>
        <SERIES_ALL />
      </div>
    </div>
  );
}

export default App;
